import React from 'react';
import logo from './logo.svg';
import './App.css';

class BreakLength extends React.component
{
	render()
	{
		return(
			<div className="BreakLength">
				<button id="add">One minute more</button>
				<div id="displayBreakLength"></div>
				<button id="reduce">One minute less</button>
			</div>
		);
	}
}
class App extends React.Component 
{
	render()
	{
		return (
			<div className="App">
			</div>
		);
	}
}

export default App;
